  \"2015-11-20T22:40:12.309285\",\n\t\"name\": \"aquatic-nuisance-species-locator\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Data in this map has been collected by
  the United States Geological Survey's Nonindigenous Aquatic Species program located
  in Gainesville, Florida (http://nas.er.usgs.gov/default.aspx). This dataset may
  have some inaccuracies and is only current to June 15, 2012. The species identified
  in this dataset are not inclusive of all aquatic nuisance species, but rather a
  subset identified to be at risk for transport by recreational activities such as
  boating and angling. Additionally, the locations where organisims have been identified
  are also not inclusive and should be treated as a guide. Organisms are limited to
  the following: American bullfrog, Asian clam, Asian shore crab, Asian tunicate,
  Australian spotted jellyfish, Chinese mitten crab, New Zealand mudsnail, Colonial
  sea squirt, Alewife, Bighead carp, Black carp, Flathead catfish, Grass carp, Green
  crab, Lionfish, Northern snakehead, Quagga mussel, Round Goby, Ruffe, Rusty crayfish,
  Sea lamprey, Silver carp, Spiny water flea, Veined rapa whelk, Zebra mussel\",\n\t\"license_title\":
